```html
<canvas id="pascalsTriangle" width="300" height="200"></canvas>

<script>
  const canvas = document.getElementById("pascalsTriangle");
  const ctx = canvas.getContext("2d");

  function drawPascalsTriangle(n) {
    const halfLineHeight = canvas.height / 2;
    const thickness = halfLineHeight / 4;
    const space = halfLineHeight / 2;
    const lines = Math.floor(n / 2) + 1;
    for (let i = 0; i < lines; i++) {
      ctx.fillText(`${n - (i * 2)} ${breakLine(n - (i * 2), lines)}`, 10, (i + 1) * (halfLineHeight + space));
      ctx.fillText(`${i * 2} ${breakLine(i * 2, lines)}`, 10, (i + 1) * (halfLineHeight + space) - thickness);
    }
  }

  function breakLine(n, lineNumber) {
    if (n === 1) {
      return "";
    } else {
      const spaces = lineNumber >= 1 && lineNumber <= n - 1 ? " " : "";
      return spaces + "Sum" + spaces;
    }
  }

  drawPascalsTriangle(5);
</script>
```
